import React, { useState } from 'react';
import { TextField, Button, MenuItem, Select, InputLabel, FormControl, Box, Typography } from '@mui/material';

const ProyectoForm = () => {
    const [nombre, setNombre] = useState('');
    const [descripcion, setDescripcion] = useState('');
    const [fechaInicio, setFechaInicio] = useState('');
    const [fechaFinalizacion, setFechaFinalizacion] = useState('');
    const [estado, setEstado] = useState('En progreso');
    const [presupuesto, setPresupuesto] = useState('');
    const [idResponsable, setIdResponsable] = useState('');

    // Función para manejar el envío del formulario
    const handleSubmit = async (e) => {
        e.preventDefault();

        const proyectoData = {
            nombre,
            descripcion,
            fecha_inicio: fechaInicio,
            fecha_finalizacion: fechaFinalizacion,
            estado,
            presupuesto,
            id_responsable: idResponsable
        };

        try {
            const response = await fetch('http://localhost:5000/api/proyectos', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(proyectoData),
            });

            if (response.ok) {
                alert('Proyecto insertado correctamente');
                // Limpiar el formulario después de la inserción
                setNombre('');
                setDescripcion('');
                setFechaInicio('');
                setFechaFinalizacion('');
                setEstado('En progreso');
                setPresupuesto('');
                setIdResponsable('');
            } else {
                alert('Error al insertar el proyecto');
            }
        } catch (error) {
            console.error('Error:', error);
            alert('Hubo un error al procesar tu solicitud');
        }
    };

    return (
        <Box sx={{ maxWidth: 600, margin: '0 auto', padding: 2 }}>
            <Typography variant="h5" align="center" gutterBottom>
                Crear Proyecto
            </Typography>
            <form onSubmit={handleSubmit}>
                <TextField
                    label="Nombre del Proyecto"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    value={nombre}
                    onChange={(e) => setNombre(e.target.value)}
                    required
                />
                <TextField
                    label="Descripción"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    value={descripcion}
                    onChange={(e) => setDescripcion(e.target.value)}
                    required
                    multiline
                    rows={4}
                />
                <TextField
                    label="Fecha de Inicio"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    type="date"
                    value={fechaInicio}
                    onChange={(e) => setFechaInicio(e.target.value)}
                    required
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
                <TextField
                    label="Fecha de Finalización"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    type="date"
                    value={fechaFinalizacion}
                    onChange={(e) => setFechaFinalizacion(e.target.value)}
                    required
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
                <FormControl fullWidth margin="normal" required>
                    <InputLabel>Estado</InputLabel>
                    <Select
                        value={estado}
                        onChange={(e) => setEstado(e.target.value)}
                        label="Estado"
                    >
                        <MenuItem value="En progreso">En progreso</MenuItem>
                        <MenuItem value="Finalizado">Finalizado</MenuItem>
                        <MenuItem value="Suspendido">Suspendido</MenuItem>
                    </Select>
                </FormControl>
                <TextField
                    label="Presupuesto"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    type="number"
                    step="0.01"
                    value={presupuesto}
                    onChange={(e) => setPresupuesto(e.target.value)}
                />
                <TextField
                    label="Responsable (ID)"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    type="number"
                    value={idResponsable}
                    onChange={(e) => setIdResponsable(e.target.value)}
                    required
                />
                <Button
                    type="submit"
                    variant="contained"
                    color="primary"
                    fullWidth
                    sx={{ marginTop: 2 }}
                >
                    Insertar Proyecto
                </Button>
            </form>
        </Box>
    );
};

export default ProyectoForm;
